import React from 'react'

 function languageItem() {

    const language = [
        {
            icon : "fab fa-html5",
            text : "HTML5"
        }, 
        {
            icon : "fab fa-css3",
            text : "CSS3"
        },
        {
            icon : "fab fa-js",
            text : "JavaScript"
        }
        ,
        {
            icon : "fab fa-html5",
            text : "HTML5"
        }
    ]

    return (
        <div className="language">
            
        </div>
    )
}

export default languageItem;
